    },
    {
      title: "Chair"
    },
    {
      title: "Chair"
    }
  ];

  const ProductDeck = mockdata.map(project => {
    return <GalleryCard className={styles.tempCard}> Gallery Card </GalleryCard>
  })

  return (
    <section className={styles['list-container']}>
      <ProductDeck />
    </section>
  )
}

export default GalleryList;
